```let x, id, result = [];
function getTotalStock(product_id) {
    let x, total = 0;
    for (x in stockData) {
        if (stockData[x].productId === product_id) {
            total += stockData[x].stock;
        }
    }
    return total;
}
function getLocation(location_id) {
    let x;
    for (x in locationData) {
        if (location_id === locationData[x].locationId) {
            return locationData[x].locationName;
        }
    }
}
function getProductDetail(product_id) {
    let x, r = [];
    for (x in stockData) {
        if (stockData[x].productId === product_id) {
            r.push({
                locationName: getLocation(stockData[x].locationId),
                stock: stockData[x].stock
            });
        }
    }
    return r;
}
for (x in productData) {
    id = productData[x].productId;
    result.push({
        productName: productData[x].productName,
        stock: {
            total: getTotalStock(id),
            detail: getProductDetail(id)
        }
    });
}
