`@JdbcRepository(dialect = DIALECT.PG)
class UserRepository: CrudRepository<User, UUID>

@Controller
Class UserController (private val repository: UserRepository){

    @Get("/") fun getAllUser() = repository.findAll()

    @Get("/{id}") fun getUserById(id: UUID) = repository.findById(id)

    @Post("/") fun saveUser(@Body user: User) = repository.save(user)

    @Delete("/{id}") fun deleteUserById(id: UUID) = repository.deleteById(id)

}`

