public boolean isRevoked(String name,String certificate) throws IOException, InterruptedException {
     boolean flag = false;
     createUserPem(name,certificate);
     ProcessBuilder ps=new ProcessBuilder("cmd.exe","/c","openssl ocsp -issuer SUBPRIVYCA2.cacert.pem -cert "+name+".pem  -CAfile chain-"+name+".pem  -text -url https://ocsp-uat.privyca.id -header "Host"="ocsp-uat.privyca.id"");
  ps.directory(new File("C:\OpenSSL\bin"));
  ps.redirectErrorStream(true);
  Process pr = ps.start();  
  BufferedReader in = new BufferedReader(new InputStreamReader(pr.getInputStream()));
  String line = "";
  while ((line = in.readLine()) != null) {
   System.out.println(line);
      if(line.contains("revoked")) {
       flag = true;
      }
  }
  pr.waitFor();
  in.close();
  return flag;
    }

